        background-position: center;
        background-size: cover;
      }

      &:hover {
        .child {
          display: block;
          width: 100%;
          height: 100%;
        }
      }
    }

    .h9figure-cursor-area {
      width: 65rem;
      height: 65rem;
      position: absolute;
    }
  }

