  position: relative;
  z-index: 1;

  .right {
    display: flex;
    align-items: center;
    width: 8rem;
    padding-top: 4.5rem;
    border-left: 1px solid $primary-blue;
    writing-mode: tb-rl;

    a {
      font-size: 2rem;
    }
  }
}

