    transition: transform .5s cubic-bezier(.14, .99, .43, .99), background .5s cubic-bezier(.14, .99, .43, .99);
    display: flex;
    justify-content: center;
    align-items: center;
    transform-origin: 50% 50%;
    transform: scale(0);

    &.active {
      transform: scale(4);
    }
  }

